import React, { useState, useRef, useEffect } from 'react';
import './styles/journey.css';

const VerticalTimeline = () => {
  const [activeIndex, setActiveIndex] = useState(0);
  const [progress, setProgress] = useState(0);
  const timelineRef = useRef(null);

  const milestones = [
    { year: '2018', title: 'First Steps', description: 'Started our journey with a small team and big dreams.' },
    { year: '2019', title: 'Growth Phase', description: 'Expanded our services and reached new markets.' },
    { year: '2020', title: 'Adaptation', description: 'Pivoted during challenging times and found new opportunities.' },
    { year: '2021', title: 'Breakthrough', description: 'Launched our flagship product to great acclaim.' },
    { year: '2022', title: 'Expansion', description: 'Opened offices in three new countries.' },
    { year: '2023', title: 'Innovation', description: 'Introduced groundbreaking AI technology to our platform.' },
    { year: '2024', title: 'Future Vision', description: 'Setting new industry standards with our latest initiatives.' }
  ];

  // Handle scroll to update active milestone
  useEffect(() => {
    const handleScroll = () => {
      if (timelineRef.current) {
        const timeline = timelineRef.current;
        const scrollPosition = timeline.scrollTop;
        const totalHeight = timeline.scrollHeight - timeline.clientHeight;
        const scrollProgress = (scrollPosition / totalHeight) * 100;
        setProgress(scrollProgress);

        // Calculate active index based on scroll position
        const milestoneElements = timeline.querySelectorAll('.milestone');
        let activeIdx = 0;

        milestoneElements.forEach((milestone, idx) => {
          const rect = milestone.getBoundingClientRect();
          const timelineRect = timeline.getBoundingClientRect();
          const milestoneTop = rect.top - timelineRect.top;

          if (milestoneTop <= timelineRect.height / 2) {
            activeIdx = idx;
          }
        });

        setActiveIndex(activeIdx);
      }
    };

    if (timelineRef.current) {
      timelineRef.current.addEventListener('scroll', handleScroll);
    }

    return () => {
      if (timelineRef.current) {
        timelineRef.current.removeEventListener('scroll', handleScroll);
      }
    };
  }, []);

  const scrollToMilestone = (index) => {
    if (timelineRef.current) {
      const milestoneElements = timelineRef.current.querySelectorAll('.milestone');
      if (milestoneElements[index]) {
        milestoneElements[index].scrollIntoView({ behavior: 'smooth', block: 'center' });
      }
    }
  };

  return (
    <div className="vertical-timeline-container">
      <h2 className="title-text">Our Journey Timeline</h2>
      <p className="subtitle">Follow our growth through the years</p>

      <div className="timeline-controls">
        <button 
          className="control-btn" 
          onClick={() => scrollToMilestone(activeIndex - 1)}
          disabled={activeIndex === 0}
        >
          <i className="fas fa-chevron-up"></i> Previous
        </button>
        <button 
          className="control-btn" 
          onClick={() => scrollToMilestone(activeIndex + 1)}
          disabled={activeIndex === milestones.length - 1}
        >
          Next <i className="fas fa-chevron-down"></i>
        </button>
      </div>

      <div className="vertical-timeline" ref={timelineRef}>
        <div className="snake-path">
          <div className="path-line"></div>
          <div className="path-progress" style={{ height: `${progress}%` }}></div>
          <div className="bee-container" style={{ top: `${progress}%` }}>
            <div className="bee">
              <div className="bee-body"></div>
              <div className="bee-wing left"></div>
              <div className="bee-wing right"></div>
            </div>
          </div>
        </div>

        <div className="milestones">
          {milestones.map((milestone, index) => (
            <div 
              key={index} 
              className={`milestone ${index === activeIndex ? 'active' : ''} ${index % 2 === 0 ? 'left' : 'right'}`}
            >
              <div className="milestone-content">
                <div className="milestone-header">
                  <span className="milestone-year">{milestone.year}</span>
                  <h3 className="milestone-title">{milestone.title}</h3>
                </div>
                <p className="milestone-description">{milestone.description}</p>
              </div>
              <div className="milestone-marker">
                <div className="marker-circle"></div>
              </div>
            </div>
          ))}
        </div>
      </div>

      <div className="timeline-progress">
        <div className="progress-bar">
          <div className="progress-fill" style={{ height: `${progress}%` }}></div>
        </div>
        <span className="progress-text">{Math.round(progress)}% viewed</span>
      </div>
    </div>
  );
};

export default VerticalTimeline;
